import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './component/Header/Header';
import Home from './component/Home/Home';
import Ourservice from './component/Ourservice/Ourservice';
import About from './component/About/About';
import Gallary from './component/Gallary/Gallary';
import Review from './component/Review/Review';
import Order from './component/Order/Order';
import Login from './component/Login/Login';
import Signin from './component/Signin/Signin';

import '@fortawesome/fontawesome-free/css/all.min.css';
import Contact from './component/Contact/Contact';


function App() {
    return (
        <div>
        <Router>
            <Header />
            <Ourservice />
            <About />
            <Gallary /> {/* Place Header here so that it includes navigation links */}
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/services" element={<Ourservice />} />
                <Route path="/about" element={<About />} />
                <Route path="/gallery" element={<Gallary />} />
                <Route path="/reviews" element={<Review />} />
                <Route path="/contact" element={<Contact />} />
                <Route path="/order" element={<Order />} /> {/* Add route for OrderPage */}
                <Route path='/signin' element={<Signin />} /> {/* Add route for OrderPage */}
                <Route path='/login' element={<Login     />} /> {/* Add route for OrderPage */}
            </Routes>
        </Router>
       </div>




    );
}

export default App;
